import { useState } from "react";

const Example = () => {
  const ischecked = true;
  const checkToggle = () => !ischecked;
  return (
    <>
      <input
        type="checkbox"
        checked={ischecked}
        onchange={(e) => checkToggle(e)}
      />
    </>
  );
};

export default Example;
